import './borderBlock.css'

export default function BorderBlock() {


    return (
        <>        
            <div className="border-side-div left-border" ></div>
            <div className="border-side-div right-border" ></div>
            <div className="border-upper-div top-border" ></div>
            <div className="border-upper-div buttom-border" ></div>
        </>
    )
}
